const projects = [
    {
        title: "Tic Tac Toe",
        image: require("../images/TicTacToe.png"),
        link: "https://asaggse.github.io/tic-tac-toe/",
        description: "A Tic Tac Toe game made with React"
    },
    {
        title: "Calculator",
        image: require("../images/Calculator.png"),
        link: "https://asaggse.github.io/calculator-react/",
        description: "A simple calculator application built using React"
    }
];

export default projects;
